import React from "react";
import styled from "styled-components";
// import { Link } from "react-router-dom";
import { NavBarContainer } from "../../globalStyle";
import FontIconButton from "../../components/Button/FontIconButton";
import { ReactComponent as FontSmallIcon } from "../../assets/Font Size Small.svg"; 
import { ReactComponent as FontMediumIcon } from "../../assets/Font Size Medium.svg";
import { ReactComponent as FontLargeIcon } from "../../assets/Font Size.svg";
const Nav = styled.nav`
  background: #FCFCFC;
  height: 52px;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 1rem;
  position: sticky;
  top: 0;
  z-index: 999;
 margin-bottom: 20%; 
`;

// const h1 = styled.h1`
//   font-color: #333D47;
//   font-family: "inter";
//   font-weigh: 700;
//   justify-content: center;
//   align-items: center;
//   font-size: 1rem;
//   top: 0;
//   z-index: 999;
//   /* margin-bottom: %; //TEMP style */
// `;

const NavbarContainer = styled(NavBarContainer)`
  display: flex;
  justify-content: space-between;
  height: 52px;

  ${NavBarContainer}
`;

const NavbarTitle = styled.h1`
  font-color: #333D47;
  font-family: "inter";
  font-weigh: 700;
  justify-content: center;
  align-items: center;
  font-size: 1rem;
// `;

// const date = new Date();

const StyledContainer = styled.div`
  display: flex;
`

const StyledStroke = styled.div`
  display: flex;
  width: 1px;
  background-color: #FFF;
  margin: 10px;
`

// const ServerDate = styled.div`
//   display: flex;
//   align-items: center;
//   color: #fff;
// `;

const Navbar = () => {
  return (
    <Nav>
      <NavbarContainer>
        <NavbarTitle>
        CAPO Case Management System (CCMS)
        </NavbarTitle>
        <StyledContainer>
        <StyledStroke />
        <NavbarTitle>
        SIP 45678 LAW
        </NavbarTitle>
        <FontIconButton
            id={"fontsmall"}
            ariaLabel="fontsmall"
            onClick={() => console.log("fontsmall")}
          >
            <FontSmallIcon/>
          </FontIconButton>

          <FontIconButton
            id={"fontmedium"}
            ariaLabel="fontmedium"
            onClick={() => console.log("fontmedium")}
          >
            <FontMediumIcon/>
          </FontIconButton>

          <FontIconButton
            id={"fontlarge"}
            ariaLabel="fontlarge"
            onClick={() => console.log("fontlarge")}
          >
            <FontLargeIcon/>
          </FontIconButton>
        {/* <ServerDate>
          {date.getDate() +
            "/" +
            (date.getMonth() + 1) +
            "/" +
            date.getFullYear()}
        </ServerDate> */}
        </StyledContainer>
      </NavbarContainer>
    </Nav>
  );
};

export default Navbar;
